thm cvmtop1(class c0, class c1, class c2) {
  |- wi(wcel(c0, co(c1, ccvm, c2)), wcel(c1, ctop))
} = {
  simpld(wcel(c0, co(c1, ccvm, c2)), wcel(c1, ctop), wcel(c2, ctop))
  nsyl2(wcel(c0, co(c1, ccvm, c2)), wa(wcel(c1, ctop), wcel(c2, ctop)), wceq(co(c1, ccvm, c2), emptycls))
  n0i(c0, co(c1, ccvm, c2))
  ndmov(c1, ctop, c2, ccvm)
  ax-mp(wceq(cdm(ccvm), cxp(ctop, ctop)), wfn(ccvm, cxp(ctop, ctop)))
  fncvm()
  fndm(ccvm, cxp(ctop, ctop))
}

