thm cvmtop1(class c0, class c1, class c2) {
  ⊢ (c0 ∈(c1[CovMap]c2)→ c1 ∈ Top)
} = {
  simpld(c0 ∈(c1[CovMap]c2), c1 ∈ Top, c2 ∈ Top)
  nsyl2(c0 ∈(c1[CovMap]c2), (c1 ∈ Top ∧ c2 ∈ Top), (c1[CovMap]c2)= ∅)
  n0i(c0, (c1[CovMap]c2))
  ndmov(c1, ctop, c2, ccvm)
  ax-mp(dom(CovMap)=(Top × Top), CovMap[Fn](Top × Top))
  fncvm()
  fndm(ccvm, (Top × Top))
}

